import React from 'react';
import {setsousAC} from "../../../Redux/sous-reducer";
import {connect} from "react-redux";
import Sous from "./Sous";


let mapDispatchToProps = (dispatch) => {

    return {
        setUser: (users) => {
            dispatch(setsousAC(users));
        },

    }

}

let mapStateToprops = (state) => {

    return {
        sous: state.sousPage.sous
    }


}

const SousContainer = connect(mapStateToprops, mapDispatchToProps)(Sous);
export default SousContainer
